import React, { Component }from 'react';
import {Foot} from "../list_projects_page/styles"




class Footer extends Component{
    render() {

        return (
            <Foot>
                <img src='https://www.unifeso.edu.br/images/logo/UNIFESO-BRANCO.png'/>
                
            </Foot>
        )

    }
}

export default Footer
